import React from 'react';
import { useMediaQuery } from 'react-responsive';
import heroImage from "../../assets/images/akshay.png";

const UserInterface = () => {
  // Define media queries
  const isMobileDevice = useMediaQuery({ query: "(min-device-width: 480px)" });
  const isTabletDevice = useMediaQuery({ query: "(min-device-width: 768px)" });
  const isLaptop = useMediaQuery({ query: "(min-device-width: 1024px)" });
  const isDesktop = useMediaQuery({ query: "(min-device-width: 1200px)" });
  const isBigScreen = useMediaQuery({ query: "(min-device-width: 1201px)" });

  const sectionStyle = {
    paddingTop: '0',
    backgroundColor: '#f4f4f4',
  };

  const containerStyle = {
    paddingTop: '3.5rem',
    maxWidth: '1200px',
    margin: '0 auto',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  };

  const heroLeftStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-start',
    textAlign: 'left',
    marginBottom: '2rem',
  };

  const heroRightStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  const headingStyle = {
    color: '#333',
    fontWeight: '800',
    fontSize: '1.8rem',
    lineHeight: '1.2',
    marginBottom: '0.5rem',
  };

  const subHeadingStyle = {
    fontSize: '2rem',
    color: '#555',
  };

  const buttonStyle = {
    backgroundColor: '#007bff',
    color: 'white',
    fontWeight: '500',
    display: 'flex',
    alignItems: 'center',
    gap: '0.5rem',
    padding: '0.5rem 1rem',
    borderRadius: '8px',
    border: 'none',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease-in',
  };

  const buttonHoverStyle = {
    backgroundColor: '#0056b3',
  };

  const linkStyle = {
    color: '#007bff',
    textDecoration: 'none',
    fontWeight: '600',
  };

  const descriptionStyle = {
    color: '#666',
    fontSize: '1rem',
    marginTop: '1.5rem',
    lineHeight: '1.6',
  };

  const contactStyle = {
    marginTop: '2rem',
    fontSize: '1rem',
    color: '#666',
  };

  return (
    <section style={sectionStyle} id="about">
      <div style={containerStyle}>
        <div className='md:flex items-center justify-between sm:flex-col md:flex-row'>
          <div className="w-full md:basis-1/2" style={heroLeftStyle}>
            <h5 className='text-smallTextColor font-[500] text-[16px]'>
              Hello, Welcome
            </h5>
            <h1 style={headingStyle}>
              I am Akshay Balte <br />
              <span style={subHeadingStyle}>Software Developer</span>
            </h1>
            <div className='flex items-center mt-7 gap-6'>
              <a href="#contact">
                <button 
                  style={buttonStyle} 
                  onMouseEnter={(e) => e.currentTarget.style.backgroundColor = buttonHoverStyle.backgroundColor} 
                  onMouseLeave={(e) => e.currentTarget.style.backgroundColor = buttonStyle.backgroundColor}
                >
                  <i className="ri-mail-fill"></i> Hire me
                </button>
              </a>
              <a href="#portfolio" style={linkStyle} className='text-smallTextColor font-[600] text-[16px] border-b border-solid border-smallTextColor'>
                See Portfolio
              </a>
            </div>
            <p data-aos="fade-left" data-aos-duration="1500" style={descriptionStyle} className="flex text-headingColor items-center mt-12 gap-2 font-[500] leading-5 hover:leading-6 capitalize text-justify sm:pl-14 sm:pr-10 aos-init aos-animate">
              <span className="mr-2 mb-16"><i className="ri-command-fill"></i></span>
              <span>I design and code beautifully simple things, and I love what I do! Enthusiastic Software Engineering student with a fervor for coding and a solid foundation in machine learning. Distinguished graduate known for hard work, complemented by excellent communication skills.</span>
            </p>
            <div style={contactStyle} className="gap-4 mt-14">
              <span className="text-smallTextColor text-[18px] font-[600]">Contact:</span>
              <div>
                <a href="#Email" style={linkStyle} className="text-smallTextColor text-[18px] font-[600]">
                  <i className="ri-mail-line"></i> balteakshay1998@gmail.com
                </a>
              </div>
              <div>
                <a href="https://www.linkedin.com/in/akshay-balte-developer/" style={linkStyle} className="text-smallTextColor text-[18px] font-[600]">
                  <i className="ri-linkedin-box-fill"></i> https://www.linkedin.com/in/akshay-balte-developer/
                </a>
              </div>
              <div>
                <a href="#Phone" style={linkStyle} className="text-smallTextColor text-[18px] font-[600]">
                  <i className="ri-phone-line"></i> 7447686701
                </a>
              </div>
            </div>
          </div>
          <div className="w-full md:basis-1/2" style={heroRightStyle}>
            <img src={heroImage} alt="Portrait of Akshay Balte" style={{ width: '100%', borderRadius: '8px' }} />
          </div>
        </div>
      </div>
    </section>
  );
};

export default UserInterface;
